import React, { useEffect } from "react";
import axios from "axios";

const GetData = async ({ inputform, URL }) => {
  axios.get(URL, { responseType: "json" }).then(function (response) {
    console.log(response.data);
  });

  return <div></div>;
};

export default GetData;
